import './App.css';
import Alert from 'react-bootstrap/Alert';
import NewTable from './components/Table';
import 'bootstrap/dist/css/bootstrap.min.css';
import Container from 'react-bootstrap/Container';

function App() {
  return (
    <div className="App">
      <Container>
        <NewTable />
      </Container>
    </div>
  );
}

export default App;
